import React from 'react';
import Form from 'react-bootstrap/Form';

const LevelTwoForm = () => {
    return (
        <div>
            <h2>Level Two</h2>
            <Form>
                <Form.Group>
                    <Form.Label>Image Upload</Form.Label>
                    <Form.File></Form.File>
                </Form.Group>

                <Form.Group>
                    <Form.Label>Discount To Keep</Form.Label>
                    <br />
                    Refund or Replacement? then {'\n'}
                    Order over $50 {'\n'}
                    if under {'\n'}
                    place no cost replacement order? {'\n'}
                        if no: {'\n'}
                            OOS or refund preferred? {'\n'}
                                if refund: {'\n'}
                                    refund in solidus
                        if yes: {'\n'}
                            Place replacement order
                        Submit damage claim form
                    if over {'\n'}
                    File Case

                </Form.Group>

                <Form.Group>
                    <Form.Label>Refund Amount (Solidus)</Form.Label>
                </Form.Group>
            </Form>
        </div>
    )
}

export default LevelTwoForm;
